  `ORDER_POSTSCRIPT` varchar(255) DEFAULT NULL COMMENT '订单附言',
  `PAY_NOTE` varchar(255) DEFAULT NULL COMMENT '付款备注',
  `CACEL_USER_ID` varchar(32) DEFAULT NULL COMMENT '取消订单的操作员id',
  `COUPON_NO` varchar(32) DEFAULT NULL COMMENT '优惠劵编号',
  `SCORE_DEDUCTION` int(11) NOT NULL DEFAULT '0' COMMENT '积分抵扣',
  `DISCOUNT_DEDUCTION` int(11) NOT NULL DEFAULT '0' COMMENT '折扣抵扣',
  `COUPON_TICKET_DEDUCTION` int(11) NOT NULL DEFAULT '0' COMMENT '优惠劵抵扣',
