DROP TABLE IF EXISTS `security_module`;
CREATE TABLE `security_module` (
  `SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '物理主键',
  `MODULE_CODE` varchar(32) NOT NULL COMMENT '模块代码',
  `MODULE_NAME` varchar(32) NOT NULL COMMENT '模块名称',
