#
# Structure for table "systemctl_comment"
#

DROP TABLE IF EXISTS `systemctl_comment`;
CREATE TABLE `systemctl_comment` (
  `SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '物理主键',
  `USER_ID` bigint(20) NOT NULL COMMENT '评论者ID',
  `TARGET_TYPE` varchar(16) NOT NULL COMMENT '评论的对象实体类型',
  `TARGET_SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '评论对象实体外键',
  `COMMENT_BODY` varchar(1000) DEFAULT NULL COMMENT '评论内容',
  `IMG1` varchar(1000) DEFAULT NULL COMMENT '评论图片1',
  `IMG2` varchar(1000) DEFAULT NULL COMMENT '评论图片2',
  `IMG3` varchar(1000) DEFAULT NULL COMMENT '评论图片3',
  `HAS_IMAGE` varchar(1) DEFAULT NULL COMMENT '是否有图(Y,N)',
  `IS_AUDIT` varchar(1) DEFAULT NULL COMMENT '是否已经审核',
  `AUDIT_STATUS` varchar(1) DEFAULT NULL COMMENT '审核是否通过',
  `REC_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `REC_USER_ID` varchar(32) DEFAULT NULL COMMENT '创建者',
  `REC_STATUS` varchar(1) DEFAULT NULL COMMENT '数据状态',
  `EXTEND1` varchar(32) DEFAULT NULL COMMENT '扩展字段1',
  `EXTEND2` varchar(32) DEFAULT NULL COMMENT '扩展字段2',
  `EXTEND3` varchar(32) DEFAULT NULL COMMENT '扩展字段3',
  `DESCRIPTION` varchar(255) DEFAULT NULL COMMENT '备注',
  `STAR_SCORE` decimal(10,2) DEFAULT NULL COMMENT '评论星级',
  PRIMARY KEY (`SEQUENCE_NBR`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='评论信息';

