#
# Structure for table "systemctl_location_relation"
#

DROP TABLE IF EXISTS `systemctl_location_relation`;
CREATE TABLE `systemctl_location_relation` (
  `SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '物理主键',
  `LOCATION_CODE` varchar(16) DEFAULT NULL COMMENT '本地系统编码',
  `REF_LOCATION_CODE` varchar(16) DEFAULT NULL COMMENT '外部系统编码',
  `REF_LOCATION_NAME` varchar(100) DEFAULT NULL COMMENT '外部系统位置名称',
  `THIRD_PARTY_NAME` varchar(100) DEFAULT NULL COMMENT '外部系统类型',
  PRIMARY KEY (`SEQUENCE_NBR`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='位置关系表';

#
# Data for table "systemctl_location_relation"
#


#
# Structure for table "systemctl_richtext_refer"
#

DROP TABLE IF EXISTS `systemctl_richtext_refer`;
CREATE TABLE `systemctl_richtext_refer` (
  `SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '物理主键',
  `ENTITY_TYPE` varchar(255) NOT NULL COMMENT '实体类型(全限定实体类名)',
  `ENTITY_ID` bigint(20) NOT NULL,
  `RICHTEXT_TYPE` varchar(32) NOT NULL COMMENT '当前富文本类型(一个实体可能会关联多个富文本)',
  `RICHTEXT_REFER` bigint(20) NOT NULL COMMENT '富文本内容引用(mongo中的docID)',
  `REC_DATE` datetime NOT NULL COMMENT '创建时间',
  `REC_USER_ID` varchar(16) NOT NULL COMMENT '创建者',
  `REC_STATUS` varchar(1) NOT NULL COMMENT '数据状态 :I 非激活 /A  激活',
  `EXTEND1` varchar(32) DEFAULT NULL COMMENT '扩展字段1',
  `EXTEND2` varchar(32) DEFAULT NULL COMMENT '扩展字段2',
  `EXTEND3` varchar(32) DEFAULT NULL COMMENT '扩展字段3',
  `DESCRIPTION` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`SEQUENCE_NBR`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='RICH_TEXT_RELATION 通用的富文本存储关系表';

#
# Data for table "systemctl_richtext_refer"
#


#
# Structure for table "systemctl_sms_verify"
#

DROP TABLE IF EXISTS `systemctl_sms_verify`;
CREATE TABLE `systemctl_sms_verify` (
  `SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '物理主键',
  `SMS_CODE` varchar(32) NOT NULL COMMENT '短信编号（可以自己生成，也可以第三方复返回）',
  `MOBILE` varchar(32) NOT NULL COMMENT '电话号码',
  `SMS_VERIFY` varchar(32) DEFAULT '验证码',
