#
# Structure for table "trade_pingxx_charge"
#

DROP TABLE IF EXISTS `trade_pingxx_charge`;
CREATE TABLE `trade_pingxx_charge` (
  `SEQUENCE_NBR` bigint(20) NOT NULL,
  `order_no` varchar(100) NOT NULL COMMENT '商户订单号，适配每个渠道对此参数的要求，必须在商户系统内唯一。(alipay: 1-64 位， wx: 2-32 位，bfb: 1-20 位，upacp: 8-40 位，yeepay_wap:1-50 位，jdpay_wap:1-30 位，cnp_u:8-20 位，cnp_f:8-20 位，cmb_wallet:6 位或 10 位纯数字字符串。注：除cmb_wallet外的其他渠道推荐使用 8-20 位，要求数字或字母，不允许特殊字符)。',
  `app` varchar(50) NOT NULL COMMENT '支付使用的 app 对象的 id，请登陆管理平台查看。',
  `channel` varchar(50) NOT NULL COMMENT '支付使用的第三方支付渠道\r\n取值范围:\r\nalipay:支付宝手机支付\r\nalipay_wap:支付宝手机网页支付\r\nalipay_qr:支付宝扫码支付\r\nalipay_pc_direct:支付宝 PC 网页支付\r\nbfb:百度钱包移动快捷支付\r\nbfb_wap:百度钱包手机网页支付\r\nupacp:银联全渠道支付（2015 年 1 月 1 日后的银联新商户使用。若有疑问，请与 Ping++ 或者相关的收单行联系）\r\nupacp_wap:银联全渠道手机网页支付（2015 年 1 月 1 日后的银联新商户使用',
  `amount` int(11) NOT NULL COMMENT '订单总金额, 单位为对应币种的最小货币单位，例如：人民币为分（如订单总金额为 1 元，此处请填 100）。',
  `client_ip` varchar(100) NOT NULL COMMENT '发起支付请求客户端的 IP 地址，格式为 IPV4，如: 127.0.0.1。',
  `currency` varchar(3) NOT NULL COMMENT '三位 ISO 货币代码，目前仅支持人民币 cny。',
  `subject` varchar(100) NOT NULL COMMENT '商品的标题，该参数最长为 32 个 Unicode 字符，银联全渠道（upacp/upacp_wap）限制在 32 个字节。',
  `body` varchar(500) NOT NULL COMMENT '商品的描述信息，该参数最长为 128 个 Unicode 字符，yeepay_wap 对于该参数长度限制为 100 个 Unicode 字符。',
  `extra` varchar(255) DEFAULT NULL COMMENT '特定渠道发起交易时需要的额外参数以及部分渠道支付成功返回的额外参数。\r\nalipay:\r\n(支付宝\r\n手机支付)。\r\n参数 extern_token[string] 开放平台返回的包含账户信息的 token（授权令牌，商户在一定时间内对支付宝某些服务的访问权限）。通过授权登录后获取的 alipay_open_id，作为该参数的 value，登录授权账户即会为支付账户，32 位字符串，optional；\r\n参数 rn_check[string] 是否发起实名校验，T 代表发起实名校验；F 代表不发起实名校验',
  `time_expire` int(11) DEFAULT NULL COMMENT '订单失效时间，用 Unix 时间戳表示。时间范围在订单创建后的 1 分钟到 15 天，默认为 1 天，创建时间以 Ping++ 服务器时间为准。 微信对该参数的有效值限制为 2 小时内；银联对该参数的有效值限制为 1 小时内。',
  `metadata` varchar(255) DEFAULT NULL COMMENT '参考 Metadata 元数据。',
  `description` varchar(500) DEFAULT NULL COMMENT '订单附加说明，最多 255 个 Unicode 字符。',
  `id` varchar(50) NOT NULL COMMENT '支付对象 id ，由 Ping++ 生成，27 位长度字符串。',
  `object` varchar(32) NOT NULL COMMENT '值为 charge。',
  `created` int(11) NOT NULL COMMENT '支付创建的时间，用 Unix 时间戳表示。',
  `livemode` tinyint(1) NOT NULL COMMENT '支付是否处于 live 模式。',
  `paid` tinyint(1) NOT NULL COMMENT '是否已付款。',
  `refunded` tinyint(1) NOT NULL COMMENT '是否存在退款信息，无论退款是否成功。',
  `amount_settle` int(11) DEFAULT NULL COMMENT '清算金额，单位为对应币种的最小货币单位，例如：人民币为分。',
  `time_paid` int(11) DEFAULT NULL COMMENT '订单支付完成时间，用 Unix 时间戳表示。',
  `time_settle` int(11) DEFAULT NULL COMMENT '订单清算时间，用 Unix 时间戳表示。(仅针对个人开发者)',
  `transaction_no` varchar(100) DEFAULT NULL COMMENT '支付渠道返回的交易流水号。',
  `refunds` varchar(500) DEFAULT NULL COMMENT '退款详情列表，详见 refund 退款对象。',
  `amount_refunded` int(11) DEFAULT NULL COMMENT '已退款总金额，单位为对应币种的最小货币单位，例如：人民币为分。',
  `failure_code` varchar(100) DEFAULT NULL COMMENT '订单的错误码，详见 Errors 错误处理机制中的错误码描述。',
  `failure_msg` varchar(500) DEFAULT NULL COMMENT '订单的错误消息的描述。',
  `credential` varchar(500) NOT NULL,
  PRIMARY KEY (`SEQUENCE_NBR`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

